import React, { Component } from 'react';
import {
    Card,
    CardBody,
    CardTitle,
    CardSubtitle,
    CardText,
    Button
} from 'reactstrap';

class TA extends Component {
    state = {
        courses: [
            {
                Name: 'Programming 101',
                CourseID: 'cs-12',
                TaID: '123',
            },
            {
                Name: 'Software Engineering 101',
                CourseID: 'se-101',
                TaID: '123',
            },
        ]
    }
    toggle = () => {
        this.setState({
            isOpen: !this.state.isOpen
        })
    }
    render () {

        return (
            <Container>
                <Row>
                    { this.state.courses.map(course => (
                            <Col xs="12" md="6" lg="4">
                                <Card>
                                    <CardBody>
                                        <CardTitle tag="h5">{ course.Name }</CardTitle>
                                        <CardSubtitle tag="h6" className="mb-2 text-muted">{ course.CourseID }</CardSubtitle>
                                        <Button>Button</Button>
                                    </CardBody>
                                </Card>
                            </Col>
                        ))
                    }
                </Row>
            </Container>
        )
    }
}



export default TA;
